import React from "react";

const Categories = () => {
  return (
    <div className="categories">
      <ul>
        <li className="active">all</li>
        <li>art</li>
        <li>biography</li>
        <li>computers</li>
        <li>history</li>
        <li>poetry</li>
        <li>medical</li>
      </ul>
    </div>
  );
};

export default Categories;
